UPDATE etfs_ativos_reais 
    SET dividends_12m = CASE symbol
        WHEN 'IEUR' THEN 3.739 WHEN 'GINX' THEN 0.964 WHEN 'EMCR' THEN 2.9979999999999998 WHEN 'CWEB' THEN 1.465 WHEN 'MTBA' THEN 1.0 WHEN 'IMTM' THEN 1.985 WHEN 'FUNL' THEN 2.508 WHEN 'DWAS' THEN 0.65 WHEN 'BIZD' THEN 1.791 WHEN 'KOOL' THEN 0.067 WHEN 'XYLD' THEN 1.554 WHEN 'ESGS' THEN 0.94574 WHEN 'VGSR' THEN 0.319 WHEN 'MRNY' THEN 0.621 WHEN 'MFUS' THEN 0.791 WHEN 'QDF' THEN 1.3649999999999998 WHEN 'TCHI' THEN 1.219 WHEN 'AGNG' THEN 0.523 WHEN 'FLIA' THEN 3.6139999999999994 WHEN 'BLCV' THEN 0.504
    END,
    updatedat = NOW()
    WHERE symbol IN ('IEUR', 'GINX', 'EMCR', 'CWEB', 'MTBA', 'IMTM', 'FUNL', 'DWAS', 'BIZD', 'KOOL', 'XYLD', 'ESGS', 'VGSR', 'MRNY', 'MFUS', 'QDF', 'TCHI', 'AGNG', 'FLIA', 'BLCV');